import React from 'react';
import TaskTile from './TaskTile';

function App() {
  const tasks = [
    { title: "Follow up with Walmart buyer", status: "In Progress" },
    { title: "Reply to Zappo Candy lead", status: "New" },
    { title: "Book onboarding call with new brand", status: "Complete" }
  ];

  return (
    <div style={{ padding: '24px' }}>
      <h1>Project Simplify Dashboard</h1>
      <p>Welcome to your new task-based email platform.</p>
      {tasks.map((task, i) => (
        <TaskTile key={i} title={task.title} status={task.status} />
      ))}
    </div>
  );
}

export default App;
